import { TimeRecordBtn } from "../worklist/element/timeBtn/TimeRecordBtn";

export const View = ({ viewObj, setDate, viewDate }) => {
  const wakeItem = (
    <li
      className={
        "workList__wakeTime-display workList__time-display workList__time workList__wakeTime listView__element"
      }
    ></li>
  );
  const viewContent = <ol> {wakeItem} </ol>;
  return <li> {viewContent}</li>;
};
